import React from 'react';
import './Channel.css';
import { FaHashtag } from "react-icons/fa";

function Channel() {
    return (
        <div className='channel'>
            <div>
                <FaHashtag />
                <p className='channel_title'>siema</p>
            </div>

        </div>
    )
}

export default Channel
